import React, { Component } from 'react';
import Button from '@material-ui/core/Button';

import './Main.css';

class Main extends Component {
  render() {
    return (
      <div className="Main">
        <header className="Main-header">
          <p>
            #Which Celeb Is You?
          </p>
          <Button variant="contained" color="primary">
            Start
          </Button>
        </header>
      </div>
    );
  }
}

export default Main;
